/// Get the GeneralCategory attribute for a Unicode code-point.
///
/// # Arguments
///  - `code_point` A code-point in the form of a rust `char`.
///
/// # Returns
/// A GeneralCategory attribute of the Unicode code-point.
#[must_use] pub const fn get_general_category(code_point: char) -> GeneralCategory
{
    const INDEX_MASK : usize = (1 << GENERAL_CATEGORY_INDEX_BITS) - 1;
    const COLUMN_MASK : usize = (1 << GENERAL_CATEGORY_COLUMN_BITS) - 1;

    let code_point_value = code_point as usize;
    let code_point_lo = code_point_value % GENERAL_CATEGORY_CHUNK_SIZE;
    let mut code_point_hi = code_point_value / GENERAL_CATEGORY_CHUNK_SIZE;
    if code_point_hi > GENERAL_CATEGORY_INDEX_LEN - 1 {
        code_point_hi = GENERAL_CATEGORY_INDEX_LEN - 1;
    }

    let index_offset = code_point_hi * GENERAL_CATEGORY_INDEX_BITS;
    let index_byte_offset = index_offset / 8;
    let index_bit_offset = index_offset % 8;
    let mut index: usize = 0;
    index |= (GENERAL_CATEGORY_DATA[GENERAL_CATEGORY_INDEX_BYTE_OFFSET + index_byte_offset + 3] as usize) << 24;
    index |= (GENERAL_CATEGORY_DATA[GENERAL_CATEGORY_INDEX_BYTE_OFFSET + index_byte_offset + 2] as usize) << 16;
    index |= (GENERAL_CATEGORY_DATA[GENERAL_CATEGORY_INDEX_BYTE_OFFSET + index_byte_offset + 1] as usize) << 8;
    index |= (GENERAL_CATEGORY_DATA[GENERAL_CATEGORY_INDEX_BYTE_OFFSET + index_byte_offset + 0] as usize) << 0;
    index >>= index_bit_offset;
    index &= INDEX_MASK;

    let column_offset = (index * GENERAL_CATEGORY_CHUNK_SIZE + code_point_lo) * GENERAL_CATEGORY_COLUMN_BITS;
    let column_byte_offset = column_offset / 8;
    let column_bit_offset = column_offset % 8;

    let mut value: usize = 0;
    value |= (GENERAL_CATEGORY_DATA[column_byte_offset + 1] as usize) << 8;
    value |= (GENERAL_CATEGORY_DATA[column_byte_offset + 0] as usize) << 0;
    value >>= column_bit_offset;
    value &= COLUMN_MASK;

    return match value {
        0 => GeneralCategory::Cn,
        1 => GeneralCategory::Cc,
        2 => GeneralCategory::Zs,
        3 => GeneralCategory::Po,
        4 => GeneralCategory::Sc,
        5 => GeneralCategory::Ps,
        6 => GeneralCategory::Pe,
        7 => GeneralCategory::Sm,
        8 => GeneralCategory::Pd,
        9 => GeneralCategory::Nd,
        10 => GeneralCategory::Lu,
        11 => GeneralCategory::Sk,
        12 => GeneralCategory::Pc,
        13 => GeneralCategory::Ll,
        14 => GeneralCategory::So,
        15 => GeneralCategory::Lo,
        16 => GeneralCategory::Pi,
        17 => GeneralCategory::Cf,
        18 => GeneralCategory::No,
        19 => GeneralCategory::Pf,
        20 => GeneralCategory::Lt,
        21 => GeneralCategory::Lm,
        22 => GeneralCategory::Mn,
        23 => GeneralCategory::Me,
        24 => GeneralCategory::Mc,
        25 => GeneralCategory::Nl,
        26 => GeneralCategory::Zl,
        27 => GeneralCategory::Zp,
        28 => GeneralCategory::Cs,
        29 => GeneralCategory::Co,
        _ => GeneralCategory::Cn,
    };
}

